  const location = useLocation()
  const { routine } = location.state
  console.log(routine)
  const name = routine[routine.length - 1].name;

  return (
    <S.Container>
      {routine.map((exercise) => (
        <ExerciseCard 
          key={exercise.id}
        />
      ))}
    </S.Container>


  )
};

